INSERT INTO `tbl_book_publication` (`id`, `slug`, `title`, `content`, `added_time_stamp`, `edited_time_stamp`, `status`) VALUES
(3, 'book_writing_consultancy', 'Book Writing Consultancy', '<p><i>Comming Soon...</i></p>', '0000-00-00 00:00:00', NULL, 3),
(4, 'book_publication_consultacy', 'Book Publication Consultancy', '<p><i>Comming Soon....</i></p>', '0000-00-00 00:00:00', NULL, 1),
(5, 'thesis_publication', 'Thesis to Book Publication', '<p><span>Generally, motto for obtaining PG courses is directly linked to the aspiration of becoming a professor. Thus, going for Ph.D. degree serves three purposes (i) to get a professorship in college and university level (ii) promotions after employment (iii) financial incentives. Caged into this three-dimensional stereotypical approach, most aspirants do not even find the exposure to explore other alternatives that are more or equally lucrative. Though during education, one is taught to think big but due to peer pressure and sublimity of corresponding careers one&rsquo;s mind eventually gets limited. If the thesis paper can be converted to an international standard book on international platforms backed by an enduring marketing bash then the researcher is made capable of name, fame, reputation alongside constant revenue generation. Understanding the basic instinct of human nature, IIPARS makes way for an academician to create an identity of his own that too on an international scale. Valuing your effort put into a thesis making, we with our innovative package of converting thesis to an international standard book can reinstate your thesis from a domestic library to an international forum where thousands of students would facilitate their growth and research depending on your shown path. We are old school believers where we believe knowledge gets multiplied only when it is shared. Just as the brave saint once said, imparting education is the biggest charity ever. We are here to help you share your knowledge out with the world.</span></p>', '0000-00-00 00:00:00', NULL, 1),
(6, 'dissertation_publication', 'M.Phil. Dissertation to Book Publication', '<p>You cannot write a half-baked biography at 30 but can surely write a book. We all have wished to write a book at some point of time of our life that would showcase all the colours of our emotions. IIPARS hereby presenting you the opportunity to blend your education with emotion and putting that on pen and paper by turning your project into a full-fledged book. Mostly Post Graduate and B.Ed. students tends to put in half-hearted effort for projects and assignments with the common intent of it as an academic trajectory that has no other implication other than an assessment to be presented. IIPARS helps a student to paint the canvas of efforts put into a research paper.</p>\r\n<p><br /><br /></p>\r\n<p>Just like our thesis to book service, we are converging students&rsquo; project work into international standard book. Generally, a preconceived notion has already been existing among the students that these projects do not serve a higher heuristic purpose and thus a well cottoned situation has been eventually existing in which post graduate students are not invested as expected into their projects. IIPARS enjoins this with the motto of actualizing the bona fide intention of the task of projects at the first place. Thus, our institute provides students an opportunity to project themselves before the world through converting it into an international standard book. This way we value both the effort put in by a student in making a project and also giving the recognition it deserves.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Services:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>1) 13-digit ISBN allotment to your book<br />2) Formatting to standard book<br />3) Upgradation (Background of the study, Literature review) (Applicable for only Social Sciences)<br />4) Plagiarism checking<br />5) Copyright to the authors<br />6) Cover page design<br />7) Multi colour cover page printing with hard binding<br />8) Black and white main content printing<br />9) 10 complimentary copies to authors<br />10) Online sales through Amazon, Flipkart, Google Book, Google Kindle, Google Play Book, Oxford Bookstore<br />11) Offline sales through Offline Distributorship throughout India 12) Free shipping facility<br />13) 30% of MRP will be given to author(s) as royalty for each sale</p>\r\n<p>&nbsp;</p>\r\n<p>*** When a student writes a project, it is absolutely his or her unique creation. But if you want your project to be converted into a world standard book, it needs word by word, sentence by sentence proof checking. A dynamic team of experts will do the same on behalf of IIPARS. Your dream project will become a world-famous book. From a student it might be that, over night you will become a celebrity author. (Applicable for Dissertation or Project Work to Book Conversion and Publication only)</p>\r\n<p><br /><br /></p>\r\n<p><strong>Technical Benefits:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>1) Conversion of PhD thesis as a book is one of the standard approaches of helping Students and Academic Community<br />2) Adds leverage towards increments based on publishing<br />3) Author(s) can use the details for NAAC &amp; NBA criteria<br />4) In adds weightage to your profile/resume to display yourself as Author<br />5) ISBN gives unique recognition to you and your book</p>\r\n<p><br /><br /></p>\r\n<p><strong>Technical Benefits:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>45 &ndash; 60 days from the day of submission of required documents in required format.<br /><i>Now you are owning a book with an ISBN number. At last your dream has come true. You have become a recognized writer. Being the writer and having the copyright of that book you have authority to sell your book wherever you want. IIPARS just offering you a beautiful proposal to be the marketing counter part of your book if you wish.</i><br /><br /><br /><i>We are very much hopeful that we are going to be your marketing partner. If we really get that beautiful opportunity we will give our utmost effort and will do the poetic justice for your product.</i></p>', '0000-00-00 00:00:00', NULL, 1),
