(21, 'Olivia Johnson', 'no-reply@nooooo-reply.com', 'This crypto might go up 10 times in price on 1st Feb 2021', '0484 50 46 72', 'A big group of retail traders (the retail investors like you and me) in social media platform Reddit WallStreetBets took on Wall Street Giants in the Gamestop saga.\r\n\r\nTheir mission has two main goals: Drive up stock prices to score profits for themselves, and at the same time, force the establishment investors to abandon bearish bets against struggling companies such as GameStop (GME), AMC (AMC), Macy\'s (M) and several others.\r\n\r\nGamestop\'s stock price was $18.80 as of 31st Dec 2020 and by 29th Jan 2021, it closed at $325 - a whopping 18 times!\r\n\r\nhttps://edition.cnn.com/2021/01/30/business/gamestop-reddit-rebellion-explained/index.html\r\n\r\nSubsequently the total number of users in Reddit grew from 2 million users to 7.2 million users within days.\r\n\r\n\r\nhttps://www.reddit.com/r/wallstreetbets/\r\n\r\nNow, it seems like they are targeting to push the price of Cryptocurrency (Ripple XRP) on 1st Feb.\r\n\r\nThis is their thread:\r\nhttps://www.reddit.com/r/wallstreetbets/comments/l69h57/xrp_to_the_moon/\r\n\r\nAlready, XRP\'s price has gone up by more than 50% since this news.\r\n\r\nhttps://www.investing.com/news/cryptocurrency-news/xrp-price-gains-86-after-wall-street-bets-crypto-wing-says-pump-it-2404272\r\n\r\nIf you are interested to get involved with cryptos and consider joining this action, you can buy XRP below:\r\n\r\nFor US Residents:\r\nDownload Bitrue App and sign up, get Sign-up Package at once. Open the package you will have a chance to win 60,000 XRP!  Moreover, inviting friends will get commission rebate up to 50%!http://bit.ly/3r3oPvQ\r\n', '2021-02-03'),
