(61, 'Ramon Albers', 'albers.ramon@googlemail.com', 'How to Get Everything You Want, In a Way which Helps the Whole World - Geshe Michael Roach', '04842 67 60 92', '\r\nIn his TEDx talk, he will share a teaching from the oldest printed book in the worldthe Diamond Cutter Sutrawhich helps us get everything we want in life, in a way which also helps the entire world. We will be learning an ancient method known as the Four Steps, which can be applied to five different goals: financial independence for the rest of our life; great personal and professional relationships; vibrant health and energy; a clear, happy, and focused mindand most importantly, how we can use all these to find out why we came into this world, and how we can live a life of great purpose and meaning.\r\n\r\nGeshe Michael Roach is a Princeton University graduate who spent 25 years in a Tibetan monastery and is the first American to be awarded the degree of Geshe, or Master of Buddhism. He utilized his monastery training to help build a major New York corporation which reached $250 million in annual sales, and was sold to super-investor Warren Buffett in 2009. Michael used a large portion of his business profits, and support from companies like Hewlett Packard, to found a 25-year effort to train and pay Tibetan refugees to input thousands of their endangered ancient books and make them available online for free.\r\n\r\nWe are not affiliated to Michael Roach in anyway. We are helping to spread his message to make this world a better place. Please share with your friends if you find this helpful.\r\nWatch Geshe Michael Roach\'s TED talk here.\r\nhttps://bit.ly/3znMgFe\r\n\r\nListen to the Diamond Cutter Sutra in English below in youtube:\r\nhttps://bit.ly/3zpREYz\r\nThe Diamond Sutra - \r\n\"The Diamond That Cuts Through Illusion\"\r\nA new translation In English by Alex Johnson\r\nRead by Chris Johnys.', '2021-06-19'),
(62, 'Brenda Raley', 'raley.brenda@gmail.com', 'How to Get Everything You Want, In a Way which Helps the Whole World - Geshe Michael Roach', '03.51.21.80.97', '\r\nIn his TEDx talk, he will share a teaching from the oldest printed book in the worldthe Diamond Cutter Sutrawhich helps us get everything we want in life, in a way which also helps the entire world. We will be learning an ancient method known as the Four Steps, which can be applied to five different goals: financial independence for the rest of our life; great personal and professional relationships; vibrant health and energy; a clear, happy, and focused mindand most importantly, how we can use all these to find out why we came into this world, and how we can live a life of great purpose and meaning.\r\n\r\nGeshe Michael Roach is a Princeton University graduate who spent 25 years in a Tibetan monastery and is the first American to be awarded the degree of Geshe, or Master of Buddhism. He utilized his monastery training to help build a major New York corporation which reached $250 million in annual sales, and was sold to super-investor Warren Buffett in 2009. Michael used a large portion of his business profits, and support from companies like Hewlett Packard, to found a 25-year effort to train and pay Tibetan refugees to input thousands of their endangered ancient books and make them available online for free.\r\n\r\nWe are not affiliated to Michael Roach in anyway. We are helping to spread his message to make this world a better place. Please share with your friends if you find this helpful.\r\nWatch Geshe Michael Roach\'s TED talk here.\r\nhttps://bit.ly/3znMgFe\r\n\r\nListen to the Diamond Cutter Sutra in English below in youtube:\r\nhttps://bit.ly/3zpREYz\r\nThe Diamond Sutra - \r\n\"The Diamond That Cuts Through Illusion\"\r\nA new translation In English by Alex Johnson\r\nRead by Chris Johnys.', '2021-06-27'),
