es belief. But it all aligns with what many commentators, researchers and whistleblowing insiders have been identifying for some years now. For me personally, it\'s the clearest picture yet of why the world is the way it is, and why the secrets are protected so fiercely: it may be all about racial supremacy. The Fourth Reich is alive and well.\r\n\r\nAstonishingly, our source was not pessimistic. He stressed, as do we and many others, that consciousness is awakening rapidly all over the planet and that THESE PLANNED EVENTS ARE NOT INEVITABLE. If ever there was a reason to work closely together to raise awareness of the real threat to us all, this is it.\r\n\r\nWatch this video, listen carefully to the strong message of hope and encouragement, and spread it far and wide. We stand for the potential magnificence of a united humanity that knows no racial boundaries or distinctions. Whether or not the catastrophe occurs - and many, including ourselves, maintain that it will not - we must co-create our own future, claim our power, and do whatever we can to alert people to the dangers around us... so that we can be stronger together, for the sake of our descendants and for the heritage of all living beings on Planet Earth.', '2021-07-31'),
