(16, 16, 39, 'Privacy Policy', '<p>Privacy Policy</p>', '<p>Privacy Policy</p>', 'Privacy Policy', 'Privacy Policy', NULL, '<p>1. INTRODUCTION<br />The following privacy policy is being published in accordance with the provisions of the Information Technology Act, 2000 (\"IT ACT\"), Information Technology (Intermediary Guidelines) Rules, 2011, Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011. This Privacy Policy explains the policy of teachinns.com website and teachinns.com&rsquo;s mobile application - (hereinafter referred to as \"the App\"), with respect to the disclosure, collection, storage, usage and protection of your information during the course of your interaction with the Website and the App. Please read this Privacy Policy carefully and in conjunction with the Terms of Use before accepting our services. If you do not understand this policy or do not accept any part of it, then you should not use the Platform, as the case may be. Your use and/or continued use of the Platform, as the case may amount to express consent to the terms of this Privacy Policy as well as the Terms of Use. For the purposes of this Policy, accessing the Website and the App together with any study material made available or uploaded therein or downloaded, embedded therefrom shall collectively be referred to as the \"Services\". The Website and the App shall be collectively referred to as \"the Platform\". This Privacy Policy forms part and parcel of the Terms of Use for the teachinns.com services and shall be read as a whole. Capitalized terms used here, but undefined, shall have the same meaning as attributed to them in the Terms of Use. <br /><br />2. INFORMATION COLLECTED FROM YOU<br />1) When you use the Platform by way of registration, login, purchase of study material and test series, attempting a mock test, etc. or by way of interaction via third party websites and/or mobile applications or by way of any other communication with the Platform, teachinns.com may collect your personally identifiable information including name, date of birth, gender, demographic information, photos, e-mail address, telephone number, mobile phone number, credit card or debit card details, geographic location, mailing address, social media account details including list of contacts/friends and examination preference.<br />2) Teachinns.com will use this information to validate you as a user when using the Platform, to provide the Service to you, including administration of your user account, to notify you of changes to the Service or about any changes to our terms and conditions or this privacy policy, to manage its business, including financial reporting and billing of its Service, for the development of new products and services, to send you newsletters, offers and promotion coupons to market and advertise its products and services by email, to comply with applicable laws, court orders and government enforcement agency requests, for research and analytic purposes including to improve the quality of the Service and to ensure that the Service is presented in the most effective manner for you and your device.<br />3) By registering on the Platform, you agree and confirm your consent to providing teachinns.com with your aforementioned personal information, which is lawful, necessary and permissible. You at all times have the right to discontinue the use of the Platform. Teachinns.com is not liable to provide you with its Services in the absence of or your refusal to provide the aforesaid information. Additionally, Teachinns.com is not liable to ensure or maintain the same quality of its Services to you, as it may for a user who provides all the aforementioned information.<br />3. AUTOMATIC COLLECTION OF INFORMATION<br />When you visit or interact with the Platform, apart from teachinns.com certain third-party advertisers and/or service providers may use technologies that automatically collect information about you for both transactional (e.g., confirmation of registration, notification of purchase made, etc.) and promotional (e.g., promotions, newsletters, etc.) purposes. Your information may be collected by teachinns.com or such third party advertisers and/or service providers in the following ways:-<br />Log Files: Every time you visit the Platform, teachinns.com servers automatically receive and log information from your browser and device used to access the Platform (such as IP address, device ID, details of your network operator and type, your operating system, browser type, and version, CPU speed, and connection speed). This enables us to validate you as a User, to understand your usage of the Platform and helps us to make changes and updates most suited to your needs and interests.<br />Mobile Device: When you register your mobile device or use the mobile device to access the App, In addition to the aforesaid, teachinns.com will also collect device information such as mobile device ID, model, and manufacturer details, operating system, etc. for improving the App&rsquo;s overall functionality and displaying the content according to your preferences.<br />Cookies: Cookies are data files placed on your device, used to keep track of information such as your interaction with social media websites, the content you click on, download, upload or share and other activity on the Platform, etc. in order to improve your experience of the Platform by personalizing it to your preferences and usage trends.<br />Web Beacons: Web beacons are transparent graphic images used in our email communication to you, in order to understand customer behavior and improve the overall quality, functionality, and interactivity of the Platform.<br />Mobile Analytics: Mobile analytics software is used by teachinns.com to better understand and customize the functionality of the App&rsquo;s software on your phone. This is done by collecting information such as your frequency of the App&rsquo;s usage, the features you prefer to use on the App, where the App was downloaded from, Device Id, name of other mobile applications on your device, etc.<br />Payment /Purchase Information: In order to access certain paid features and services on the Platform, you may be required to create or log into a separate account on a payment gateway or website such as &ldquo;PayTM&rdquo;. Once such an account is created, in order to process your payments/ purchases on the Platform, such payment gateway provider may require and collect your details such as name, address, phone number, email address and credit or debit card information, net banking information or details of any web wallets maintained by you. Any/all payment(s) made/processed or details provided to or shared with such authorized payment gateway providers shall be stored directly by such payment gateway providers without any information passing through or relayed to teachinns.com. We assume no liability in respect of such payments and/or information shared with or provided to such authorized payment gateway providers. It is further clarified that the aforementioned information is only used in accordance with the provisions of the applicable law and in strict adherence to this Privacy Policy.<br />Public Forums: Any information that is disclosed by you in the comments section or by way of the &ldquo;create a post&rdquo; feature becomes published information and teachinns.com shall not be held liable for the security of the same or any personal information that you disclose herein. You agree to exercise caution when disclosing any personal information or personally identifiable information in this regard.<br />Please note that we only use the aforesaid information to communicate with and/or improve the service and to better understand our users\' operating systems, for system administration and to audit the use of the service. We do not use any of the aforesaid data to identify the name, address or other personal details of any individual.<br />For the purpose of this Privacy Policy, any passwords, financial information such as credit or debit card details or other payment instrument details and any additional information prescribed by law to be sensitive that may be collected by teachinns.com during your use of the platform and the services provided thereon, shall be referred to as \"Sensitive Personal Data or Information\".<br />4. SHARING OR DISCLOSURE OF COLLECTED<br /><br />INFORMATION<br />As a strict policy, we will not disclose, share or exploit your information with anyone without your express permission.<br />However, we may be mandated under law or under contracts to make certain limited disclosures under the following circumstances:<br />Legal Necessity: Teachinns.com may share any of the aforesaid information, including your personally identifiable information or Sensitive Personal Data or Information, without obtaining a separate consent from you, if and when such information is requested or required by law or by any court or governmental agency or authority to disclose, for the purpose of verification of identity, or for the prevention, detection, investigation of any criminal activity, or for prosecution and punishment of offenses.<br />Limited Disclosure to Service Providers: We may disclose your information (but not Sensitive Personal Data or Information) to our service providers and business partners (\"Service Providers\") for the purposes of betterment and improvement of our services including but not limited to hosting the Platform, payment processing, analyzing data, providing customer service, etc, for the purpose of making various features, services, and products of teachinns.com available to you and investigating or redressing grievances. This will be in the form of aggregated anonymized data and will be under strict contractual arrangements that preserve the confidentiality and security of your personal information in accordance with this Privacy Policy.<br />Limited Disclosures for improvement of services: Teachinns.com may share the aforesaid information including your personally identifiable information (but not Sensitive Personal Data or Information) when it is required to be shared with sponsors, partners, advertisers, analytics companies or third parties for the purpose of marketing, advertising promotional offers, offering product information and market research, in connection with the Service. This will be in the form of aggregated anonymized data and will be under strict contractual arrangements that preserve the confidentiality and security of your personal information in accordance with this Privacy Policy;<br /><br />5. SECURITY OF INFORMATION COLLECTED<br />We take the security of your personal information seriously and use appropriate technical and organizational measures to protect your personal information against unauthorized or unlawful processing and against accidental loss, destruction or damage. Unfortunately, the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data which is transmitted to or from the Service. Any transmission is at your own risk.<br />We keep your personal information for no longer than is necessary for our business purposes or for legal requirements.<br /><br />6. AMENDMENTS TO THE PRIVACY POLICY<br />Teachinns.com may amend the Privacy Policy posted on the Website from time to time at its sole discretion. Your continued access or use of the platform or services constitutes your acceptance of the amendments. Your access and use of the platform and Services will be subject to the most current version of the Terms of Use, rules, and guidelines posted on the Website at the time of such use. Please regularly check the link on the home page to view the most current Privacy Policy.<br />7. REACH US<br />If you have any doubts or concerns regarding the Privacy Policy, kindly contact at contact@teachinns.com</p>', NULL),
(17, 17, 40, 'Terms & Conditions', '<p>Terms &amp; Conditions</p>', '<p>Terms &amp; Conditions</p>', 'Terms & Conditions', 'Terms & Conditions', NULL, '<p>I. Overview<br /><br />This website, Teachinns.com and all sub-domains of Teachinns.com, hereinafter referenced as site or website, are operated by Teachinns.com. Throughout the site, the terms &ldquo;we&rdquo;, &ldquo;us&rdquo; and &ldquo;our&rdquo; refer to Teachinns.com. Teachinns.com offers this website, including all information, tools, and services available from this site to you, the user, conditioned upon your acceptance of all terms, conditions, policies, and notices stated here.<br />By visiting our site and/ or purchasing something from us, you engage in our &ldquo;Service&rdquo; and agree to be bound by the following terms and conditions (&ldquo;Terms of Service&rdquo;, &ldquo;Terms&rdquo;), including those additional terms and conditions and policies referenced herein and/or available by hyperlink. These Terms of Service apply to all users of the site, including without limitation users who are browsers, vendors, customers, and/or contributors of content.<br />Please read these Terms of Service carefully before accessing or using or purchasing from our website. By accessing or using any part of the site, you agree to be bound by these Terms of Service. If you do not agree to all the terms and conditions of this agreement, then you may not access the website or use any services. If these Terms of Service are considered an offer, acceptance is expressly limited to these Terms of Service.<br />Any new features or tools which are added to the current website shall also be subject to the Terms of Service.<br />1. Website and Online Course Usage Terms<br />By agreeing to these Terms of Service, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence.<br />You may not use our products for any illegal or unauthorized purpose nor may you, in the use of the Service, violate any laws in your jurisdiction (including but not limited to copyright laws).<br />You must not transmit any worms or viruses or any code of a destructive nature.<br />A breach or violation of any of the Terms will result in an immediate termination of your Services.<br />2. General Conditions<br />We reserve the right to refuse service to anyone for any reason at any time.<br />You understand that your content (not including credit card information), may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices. Credit card information is always encrypted during transfer over networks.<br />You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without express wrote permission by us.<br />The headings used in this agreement are included for convenience only and will not limit or otherwise affect these Terms.<br />3. Accuracy, Completeness, and Timeliness of Information<br />We are not responsible if information made available on this site is not accurate, complete or current. The material on this site is provided for general information only and should not be relied upon or used as the sole basis for making decisions without consulting primary, more accurate, more complete or more timely sources of information. Any reliance on the material on this site is at your own risk.<br />This site may contain certain historical information. Historical information, necessarily, is not current and is provided for your reference only. We reserve the right to modify the contents of this site at any time, but we have no obligation to update any information on our site. You agree that it is your responsibility to monitor changes to our site.<br />4. Modifications to the Service and Prices<br />Prices for our courses, study material, online courses, and other products and services are subject to change without notice.<br />We reserve the right at any time to modify or discontinue the Service (or any part or content thereof) without notice at any time.<br />We shall not be liable to you or to any third-party for any modification, price change, suspension or discontinuance of the Service.<br />5. Products or Services<br />Certain products or services including our online courses and eBooks may be available exclusively online through the website.<br />We reserve the right but are not obligated, to limit the sales of our products or Services to any person, geographic region or jurisdiction. We may exercise this right on a case-by-case basis. We reserve the right to limit the quantities of any products or services that we offer. All descriptions of products or product pricing are subject to change at any time without notice, at our sole discretion. We reserve the right to discontinue any product at any time. Any offer for any product or service made on this site is void where prohibited.<br />We do not warrant that the quality of any products, services, information, or other material purchased or obtained by you will meet your expectations, or that any errors in the Service will be corrected.<br />6. Accuracy of Billing and Account Information<br />We reserve the right to refuse any order you place with us. We may, in our sole discretion, limit or cancel quantities purchased per person, per household or per order. These restrictions may include orders placed by or under the same customer account, the same credit card, and/or orders that use the same billing and/or shipping address. In the event that we make a change to or cancel an order, we may attempt to notify you by contacting the e-mail and/or billing address/phone number provided at the time the order was made. We reserve the right to limit or prohibit orders that, in our sole judgment, might meet certain criteria that we think might harm our business interests.<br />You agree to provide current, complete and accurate purchase and account information for all purchases made at our site. You agree to promptly update your account and other information, including your email address and credit card numbers and expiration dates so that we can complete your transactions and contact you as needed.<br />7. Third-Party Links<br />Certain content, products, and services available via our Service may include materials from third-parties.<br />Third-party links on this site may direct you to third-party websites that are not affiliated with us. We are not responsible for examining or evaluating the content or accuracy and we do not warrant and will not have any liability or responsibility for any third-party materials or websites, or for any other materials, products, or services of third-parties.<br />We are not liable for any harm or damages related to the purchase or use of goods, services, resources, content, or any other transactions made in connection with any third-party websites. Please review carefully the third-party\'s policies and practices and make sure you understand them before you engage in any transaction. Complaints, claims, concerns, or questions regarding third-party products should be directed to the third-party.<br />8. User Comments, Feedback, and Other Submissions<br />If at our request, you send certain specific submissions (for example contest entries) or without a request from us you send creative ideas, suggestions, proposals, plans, or other materials, whether online, by email, by postal mail, or otherwise (collectively, \'comments\'), you agree that we may, at any time, without restriction, edit, copy, publish, distribute, translate and otherwise use in any medium any comments that you forward to us. We are and shall be under no obligation<br />to maintain any comments in confidence;<br />to pay compensation for any comments;<br />Or (3) to respond to any comments.<br />We may, but have no obligation to, monitor, edit or remove content that we determine in our sole discretion are unlawful, offensive, threatening, libelous, defamatory, pornographic, obscene or otherwise objectionable or violates any party&rsquo;s intellectual property or these Terms of Service.<br />9. Personal Information<br />Your submission of personal information through the store is governed by our Privacy policy.<br />10. Errors, Inaccuracies, and Omissions<br />Occasionally there may be information on our site or in the Service that contains typographical errors, inaccuracies or omissions that may relate to courses descriptions, pricing, promotions, and offers. We reserve the right to correct any errors, inaccuracies or omissions, and to change or update information or cancel orders if any information in the Service or on any related website is inaccurate at any time without prior notice (including after you have submitted your order).<br />We undertake no obligation to update, amend or clarify information in the Service or on any related website, including without limitation, pricing information, except as required by law. No specified update or refresh date applied in the Service or on any related website should be taken to indicate that all information in the Service or on any related website has been modified or updated.<br />11. Prohibited Uses<br />In addition to other prohibitions as set forth in the Terms of Service, you are prohibited from using the site or its content: (a) for any unlawful purpose; (b) to solicit others to perform or participate in any unlawful acts; (c) to violate any international, federal, provincial or state regulations, rules, laws, or local ordinances; (d) to infringe upon or violate our intellectual property rights or the intellectual property rights of others; (e) to harass, abuse, insult, harm, defame, slander, disparage, intimidate, or discriminate based on gender, sexual orientation, religion, ethnicity, race, age, national origin, or disability; (f) to submit false or misleading information; (g) to upload or transmit viruses or any other type of malicious code that will or may be used in any way that will affect the functionality or operation of the Service or of any related website, other websites, or the Internet; (h) to collect or track the personal information of others; (i) to spam, phish, pretext, spider, crawl, or scrape; (j) for any obscene or immoral purpose; or (k) to interfere with or circumvent the security features of the Service or any related website, other websites, or the Internet. We reserve the right to terminate your use of the Service or any related website for violating any of the prohibited uses.<br />12. Disclaimer of Warranties; Limitation of Liability<br />We do not guarantee, represent or warrant that your use of our service will be uninterrupted, timely, secure or error-free.<br />We do not warrant that the results that may be obtained from the use of the service will be accurate or reliable.<br />You agree that from time to time we may remove the service for indefinite periods of time or cancel the service at any time, without notice to you.<br />You expressly agree that your use of, or inability to use, the service is at your sole risk. The service and all products and services delivered to you through the service are (except as expressly stated by us) provided \'as is\' and \'as available\' for your use, without any representation, warranties or conditions of any kind, either express or implied, including all implied warranties or conditions of merchantability, merchantable quality, fitness for a particular purpose, durability, title, and non-infringement.<br />13. Severability<br />In the event that any provision of these Terms of Service is determined to be unlawful, void or unenforceable, such provision shall nonetheless be enforceable to the fullest extent permitted 