ued or outstanding payment, the decision of the company shall be final.<br />17. Publication of course material<br />The course material/study material/course content will be provided in different phrase. Subscriber to our course cannot claim whole study material during purchase of course. We will send the study material in different phrase.<br />18. Contact Information<br />Questions about the Terms of Service should be sent to us at contact@teachinns.com<br />II. Pricing Policy<br />1. Price Range<br />At Teachinns.com, we have customized pricing according to the different courses and study material provided by us. The details are provided to you beforehand according to the effort, efficiency, and output of the service. Typically the range of transactions on our website varies from INR 1000 to INR 50,000.<br />2. Schedule of payment<br />The duration of our courses and the validity of our online courses are fixed. The course duration and validity are clearly mentioned in the description of these courses. The duration of the courses offered by us varies from 1 month to 6 months or at the end of examination for which course he/she purchased.<br />3. Renewal of online courses<br />Our online courses offered on our website or mobile app will not automatically. You will receive an mail before the expiry providing you with an option to renew the validity of the course. You will have to manually renew it each time by accepting the renewed price policy.<br /><br />III. Refund Policy<br />We follow a strict No Refund policy. To help you make an informed decision, all our online courses allow you to try a part of the course before you enroll for the course.<br />Teachinns.com strictly adheres to its quality policy and the same is reflected in our products. A user is asked to experience the quality level before making the actual sales by experiencing the sample or preview study material.</p>', NULL);
